import Firebase from 'firebase/app';
import 'firebase/firestore';
import 'firebase/auth';

// 1) when seeding the database you'll have to uncomment this!
import { seedDatabase } from '../seed';

const config = {
  // apiKey: '',
  // authDomain: '',
  // projectId: '',
  // storageBucket: '',
  // messagingSenderId: '',
  // appId: '',

  apiKey: 'AIzaSyCpDBzhW24-AymeDIq3daozRSGJy9ZtT04',
  authDomain: 'netflix-9dfef.firebaseapp.com',
  projectId: 'netflix-9dfef',
  storageBucket: 'netflix-9dfef.appspot.com',
  messagingSenderId: '53099824646',
  appId: '1:53099824646:web:a094b98c5dd5825b1ee587',
  databaseURL: 'https://netflix-9dfef.firebaseio.com',
};

const firebase = Firebase.initializeApp(config);

// 2) when seeding the database you'll have to uncomment this!
// seedDatabase(firebase);
// 3) once you have populated the database (only run once!), re-comment this so you don't get duplicate data

export { firebase };
